import React from 'react';
import '../styles/SignUp.css';
import { Divider, Form, Input, Typography, Button,} from 'antd';
import {} from '@ant-design/icons';

const SignUp = () => {
  return (
   <div className="signUpBg">
   <Form className='signUpForm' >
      <Typography.Title>Login Page</Typography.Title>
      <Form.Item rules={[
         {
            required: true,
            type: "text",
            message: "Please enter your name",
         },
      ]} label='User Name' name={'userName'} id='userName'>
         <Input placeholder='Enter Your Name'/>
      </Form.Item>

      <Form.Item rules={[
         {
            required: true,
            type: "email",
            message: "Please enter your Email",
         },
      ]} label='Email' name={'userEmail'} id='userEmail'>
         <Input placeholder='Enter Your Email'/>
      </Form.Item>

      <Form.Item rules={[
         {
            required: true,
            type: "number",
            message: "Please enter Mobile",
         },
      ]} label='Mobile No.' name={'userMobile'} id='userMobile'>
         <Input placeholder='Enter Your Mobile Number'/>
      </Form.Item>
      <Form.Item rules={[
         {
            required: true,
            message: "Please enter your Password",
         },
      ]} label='Password' name={'pswd'} id='userPassword'>
         <Input.Password placeholder='Enter Your password'/>
      </Form.Item>
      <Form.Item rules={[
         {
            required: true,
            message: "Please enter valid Password",
         },
      ]} label='Confirm Password' name={'rPswd'} id='rPassword'>
         <Input.Password placeholder='Re-Enter Your Password'/>
      </Form.Item>
      <Button type='primary' htmlType='submit' block>signUP</Button>
      <Divider style={{borderColor: "black"}}>or Login with</Divider>
      <div className='socialLogin'>
         <GoogleOutlined className='socialIcon' onClick={login} style={{color: "red"}}/>
         <FacebookFilled className='socialIcon' onClick={login} style={{color: "blue"}}/>
         <TwitterOutlined className='socialIcon' onClick={login} style={{color: "cyan"}}/>
         <InstagramFilled className='socialIcon' onClick={login} style={{color: "green"}}/>
   </div>
   </Form>
 </div>
  )
}

export default SignUp
